css:
.editor-colors {
  background-color: #eff1f5;
  color: #4e5a66;
}
.editor {
  background-color: #eff1f5;
  color: #4e5a66;
}
.editor .wrap-guide {
  background-color: #e2e4ea;
}
.editor .indent-guide {
  color: #e2e4ea;
}
.editor .invisible-character {
  color: #e2e4ea;
}
.editor .gutter {
  background-color: #eff1f5;
  color: #9fa6ad;
}
.editor .gutter .line-number.cursor-line {
  background-color: #e2e4ea;
  color: #9fa6ad;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #9fa6ad;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #969896;
}
.editor .invisible {
  color: #4e5a66;
}
.editor .cursor {
  color: #9fa6ad;
}
.editor .selection .region {
  background-color: #e2e4ea;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #969896;
}
.entity.name.type {
  color: #f0c674;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #b5bd68;
}
.keyword {
  color: #b294bb;
}
.keyword.control {
  color: #b294bb;
}
.keyword.operator {
  color: #4e5a66;
}
.keyword.other.special-method {
  color: #81a2be;
}
.keyword.other.unit {
  color: #de935f;
}
.storage {
  color: #b294bb;
}
.constant {
  color: #de935f;
}
.constant.character.escape {
  color: #8abeb7;
}
.constant.numeric {
  color: #de935f;
}
.constant.other.color {
  color: #8abeb7;
}
.constant.other.symbol {
  color: #b5bd68;
}
.variable {
  color: #cc6666;
}
.variable.interpolation {
  color: #bf4040;
}
.variable.parameter.function {
  color: #4e5a66;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #eff1f5;
}
.string {
  color: #b5bd68;
}
.string.regexp {
  color: #8abeb7;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #cc6666;
}
.punctuation.definition.comment {
  color: #969896;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #4e5a66;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #81a2be;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #bf4040;
}
.support.class {
  color: #f0c674;
}
.support.function {
  color: #8abeb7;
}
.support.function.any-method {
  color: #81a2be;
}
.entity.name.function {
  color: #81a2be;
}
.entity.name.class,
.entity.name.type.class {
  color: #f0c674;
}
.entity.name.section {
  color: #81a2be;
}
.entity.name.tag {
  color: #cc6666;
}
.entity.other.attribute-name {
  color: #de935f;
}
.entity.other.attribute-name.id {
  color: #81a2be;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #81a2be;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #373b41;
  color: #4e5a66;
}
.none {
  color: #4e5a66;
}
.markup.bold {
  color: #de935f;
  font-style: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #b5bd68;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #b5bd68;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b5bd68;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
